import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
function Plan() {
  const [getplan, setPlan] = useState({});

  useEffect(() => {
    async function getAllPlan() {
      try {
        const plandata = await axios.get("http://127.0.0.1:8000/list/");

        console.log(plandata);
        setPlan(plandata.data);
      } catch (error) {
        console.log(error);
      }
    }
    getAllPlan();
  }, []);
  <h1>Connect with Django</h1>;
  return (
    <div>
      <h1>Connect React JS to Django</h1>
      {getplan.map((items, i) => (
        <div>
          <h5> item id={items.id} </h5>,<h5> Item Name={items.item}</h5>
          <table class="table table-dark">
            <thead>
              <tr>
                <th scope="col">#</th>
                <th scope="col">First</th>
                <th scope="col">Last</th>
                <th scope="col">Handle</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <th scope="row">1</th>
                <td>Mark</td>
                <td>Otto</td>
                <td>@mdo</td>
              </tr>
              <tr>
                <th scope="row">2</th>
                <td>Jacob</td>
                <td>Thornton</td>
                <td>@fat</td>
              </tr>
              <tr>
                <th scope="row">3</th>
                <td>Larry</td>
                <td>the Bird</td>
                <td>@twitter</td>
              </tr>
            </tbody>
          </table>
        </div>
      ))}
    </div>
  );
}

export default Plan;
